// SPDX-License-Identifier: MIT
pragma solidity ^0.8.3;

contract SimpleStorage {
  uint storedData;

  event setStorage(uint indexed index, string msg);
  event getStorage(uint index, string msg);

  function set(uint x) public {
    storedData = x;
    emit setStorage(10, "Data setted !");
  }

  function get() public view returns (uint) {
    return storedData;
  }
}
